document.write( '    };\n' );
document.write( '\n' );
document.write( '\n' );
document.write( '    /**\n' );
document.write( '     * Updates the canvas size taking into\n' );
document.write( '     * account the backing store pixel ratio and\n' );
document.write( '     * the device pixel ratio.\n' );
document.write( '     *\n' );
document.write( '     * See article by Paul Lewis:\n' );
document.write( '     * http://www.html5rocks.com/en/tutorials/canvas/hidpi/\n' );
document.write( '     *\n' );
document.write( '     * @param {HTMLCanvasElement} canvas\n' );
document.write( '     * @param {number} opt_width\n' );
document.write( '     * @param {number} opt_height\n' );
document.write( '     * @return {boolean} Whether the canvas was scaled.\n' );
document.write( '     */\n' );
document.write( '    Runner.updateCanvasScaling = function (canvas, opt_width, opt_height) {\n' );
document.write( '        var context = canvas.getContext(\'2d\');\n' );
document.write( '\n' );
document.write( '        // Query the various pixel ratios\n' );
document.write( '        var devicePixelRatio = Math.floor(window.devicePixelRatio) || 1;\n' );
document.write( '        var backingStoreRatio = Math.floor(context.webkitBackingStorePixelRatio) || 1;\n' );
document.write( '        var ratio = devicePixelRatio / backingStoreRatio;\n' );
document.write( '\n' );
document.write( '        // Upscale the canvas if the two ratios don\'t match\n' );
document.write( '        if (devicePixelRatio !== backingStoreRatio) {\n' );
document.write( '            var oldWidth = opt_width || canvas.width;\n' );
document.write( '            var oldHeight = opt_height || canvas.height;\n' );
document.write( '\n' );
document.write( '            canvas.width = oldWidth * ratio;\n' );
document.write( '            canvas.height = oldHeight * ratio;\n' );
document.write( '\n' );
document.write( '            canvas.style.width = oldWidth + \'px\';\n' );
document.write( '            canvas.style.height = oldHeight + \'px\';\n' );
document.write( '\n' );
document.write( '            // Scale the context to counter the fact that we\'ve manually scaled\n' );
document.write( '            // our canvas element.\n' );
document.write( '            context.scale(ratio, ratio);\n' );
document.write( '            return true;\n' );
document.write( '        } else if (devicePixelRatio == 1) {\n' );
document.write( '            // Reset the canvas width / height. Fixes scaling bug when the page is\n' );
document.write( '            // zoomed and the devicePixelRatio changes accordingly.\n' );
document.write( '            canvas.style.width = canvas.width + \'px\';\n' );
document.write( '            canvas.style.height = canvas.height + \'px\';\n' );
document.write( '        }\n' );
document.write( '        return false;\n' );
document.write( '    };\n' );
document.write( '\n' );
document.write( '\n' );
document.write( '    /**\n' );
document.write( '     * Get random number.\n' );
document.write( '     * @param {number} min\n' );
document.write( '     * @param {number} max\n' );
document.write( '     * @param {number}\n' );
document.write( '     */\n' );
document.write( '    function getRandomNum(min, max) {\n' );
document.write( '        return Math.floor(Math.random() * (max - min + 1)) + min;\n' );
document.write( '    }\n' );
document.write( '\n' );
document.write( '\n' );
document.write( '    /**\n' );
document.write( '     * Vibrate on mobile devices.\n' );
document.write( '     * @param {number} duration Duration of the vibration in milliseconds.\n' );
document.write( '     */\n' );
document.write( '    function vibrate(duration) {\n' );
document.write( '        if (IS_MOBILE && window.navigator.vibrate) {\n' );
document.write( '            window.navigator.vibrate(duration);\n' );
document.write( '        }\n' );
document.write( '    }\n' );
document.write( '\n' );
document.write( '\n' );
document.write( '    /**\n' );
document.write( '     * Create canvas element.\n' );
document.write( '     * @param {HTMLElement} container Element to append canvas to.\n' );
document.write( '     * @param {number} width\n' );
document.write( '     * @param {number} height\n' );
document.write( '     * @param {string} opt_classname\n' );
document.write( '     * @return {HTMLCanvasElement}\n' );
document.write( '     */\n' );
document.write( '    function createCanvas(container, width, height, opt_classname) {\n' );
document.write( '        var canvas = document.createElement(\'canvas\');\n' );
document.write( '        canvas.className = opt_classname ? Runner.classes.CANVAS + \' \' +\n' );
document.write( '            opt_classname : Runner.classes.CANVAS;\n' );
document.write( '        canvas.width = width;\n' );
document.write( '        canvas.height = height;\n' );
document.write( '        container.appendChild(canvas);\n' );
document.write( '\n' );
document.write( '        return canvas;\n' );
document.write( '    }\n' );
document.write( '\n' );
document.write( '\n' );
document.write( '    /**\n' );
document.write( '     * Decodes the base 64 audio to ArrayBuffer used by Web Audio.\n' );
document.write( '     * @param {string} base64String\n' );
document.write( '     */\n' );
document.write( '    function decodeBase64ToArrayBuffer(base64String) {\n' );
document.write( '        var len = (base64String.length / 4) * 3;\n' );
document.write( '        var str = atob(base64String);\n' );
document.write( '        var arrayBuffer = new ArrayBuffer(len);\n' );
document.write( '        var bytes = new Uint8Array(arrayBuffer);\n' );
document.write( '\n' );
document.write( '        for (var i = 0; i < len; i++) {\n' );
document.write( '            bytes[i] = str.charCodeAt(i);\n' );
document.write( '        }\n' );
document.write( '        return bytes.buffer;\n' );
document.write( '    }\n' );
document.write( '\n' );
document.write( '\n' );
document.write( '    /**\n' );
document.write( '     * Return the current timestamp.\n' );
document.write( '     * @return {number}\n' );
document.write( '     */\n' );
document.write( '    function getTimeStamp() {\n' );
document.write( '        return IS_IOS ? new Date().getTime() : performance.now();\n' );
document.write( '    }\n' );
document.write( '\n' );
document.write( '\n' );
document.write( '    //******************************************************************************\n' );
document.write( '\n' );
document.write( '\n' );
document.write( '    /**\n' );
document.write( '     * Game over panel.\n' );
document.write( '     * @param {!HTMLCanvasElement} canvas\n' );
document.write( '     * @param {Object} textImgPos\n' );
document.write( '     * @param {Object} restartImgPos\n' );
document.write( '     * @param {!Object} dimensions Canvas dimensions.\n' );
document.write( '     * @constructor\n' );
document.write( '     */\n' );
document.write( '    function GameOverPanel(canvas, textImgPos, restartImgPos, dimensions) {\n' );
document.write( '        this.canvas = canvas;\n' );
document.write( '        this.canvasCtx = canvas.getContext(\'2d\');\n' );
document.write( '        this.canvasDimensions = dimensions;\n' );
document.write( '        this.textImgPos = textImgPos;\n' );
document.write( '        this.restartImgPos = restartImgPos;\n' );
document.write( '        this.draw();\n' );
document.write( '    };\n' );
document.write( '\n' );
document.write( '\n' );
document.write( '    /**\n' );
document.write( '     * Dimensions used in the panel.\n' );
document.write( '     * @enum {number}\n' );
document.write( '     */\n' );
document.write( '    GameOverPanel.dimensions = {\n' );
document.write( '        TEXT_X: 0,\n' );
document.write( '        TEXT_Y: 13,\n' );
document.write( '        TEXT_WIDTH: 191,\n' );
document.write( '        TEXT_HEIGHT: 11,\n' );
document.write( '        RESTART_WIDTH: 36,\n' );
document.write( '        RESTART_HEIGHT: 32\n' );
document.write( '    };\n' );
document.write( '\n' );
document.write( '\n' );
document.write( '    GameOverPanel.prototype = {\n' );
document.write( '        /**\n' );
document.write( '         * Update the panel dimensions.\n' );
document.write( '         * @param {number} width New canvas width.\n' );
document.write( '         * @param {number} opt_height Optional new canvas height.\n' );
document.write( '         */\n' );
document.write( '        updateDimensions: function (width, opt_height) {\n' );
document.write( '            this.canvasDimensions.WIDTH = width;\n' );
document.write( '            if (opt_height) {\n' );
document.write( '                this.canvasDimensions.HEIGHT = opt_height;\n' );
document.write( '            }\n' );
document.write( '        },\n' );
document.write( '\n' );
document.write( '        /**\n' );
document.write( '         * Draw the panel.\n' );
document.write( '         */\n' );
document.write( '        draw: function () {\n' );
document.write( '            var dimensions = GameOverPanel.dimensions;\n' );
document.write( '\n' );
document.write( '            var centerX = this.canvasDimensions.WIDTH / 2;\n' );
document.write( '\n' );
document.write( '            // Game over text.\n' );
document.write( '            var textSourceX = dimensions.TEXT_X;\n' );
document.write( '            var textSourceY = dimensions.TEXT_Y;\n' );
document.write( '            var textSourceWidth = dimensions.TEXT_WIDTH;\n' );
document.write( '            var textSourceHeight = dimensions.TEXT_HEIGHT;\n' );
document.write( '\n' );
document.write( '            var textTargetX = Math.round(centerX - (dimensions.TEXT_WIDTH / 2));\n' );
document.write( '            var textTargetY = Math.round((this.canvasDimensions.HEIGHT - 25) / 3);\n' );
document.write( '            var textTargetWidth = dimensions.TEXT_WIDTH;\n' );
document.write( '            var textTargetHeight = dimensions.TEXT_HEIGHT;\n' );
document.write( '\n' );
document.write( '            var restartSourceWidth = dimensions.RESTART_WIDTH;\n' );
document.write( '            var restartSourceHeight = dimensions.RESTART_HEIGHT;\n' );
document.write( '            var restartTargetX = centerX - (dimensions.RESTART_WIDTH / 2);\n' );
document.write( '            var restartTargetY = this.canvasDimensions.HEIGHT / 2;\n' );
document.write( '\n' );
document.write( '            if (IS_HIDPI) {\n' );
document.write( '                textSourceY *= 2;\n' );
document.write( '                textSourceX *= 2;\n' );
document.write( '                textSourceWidth *= 2;\n' );
document.write( '                textSourceHeight *= 2;\n' );
document.write( '                restartSourceWidth *= 2;\n' );
document.write( '                restartSourceHeight *= 2;\n' );
document.write( '            }\n' );
document.write( '\n' );
document.write( '            textSourceX += this.textImgPos.x;\n' );
document.write( '            textSourceY += this.textImgPos.y;\n' );
document.write( '\n' );
document.write( '            // Game over text from sprite.\n' );
document.write( '            this.canvasCtx.drawImage(Runner.imageSprite,\n' );
document.write( '                textSourceX, textSourceY, textSourceWidth, textSourceHeight,\n' );
document.write( '                textTargetX, textTargetY, textTargetWidth, textTargetHeight);\n' );
document.write( '\n' );
document.write( '            // Restart button.\n' );
document.write( '            this.canvasCtx.drawImage(Runner.imageSprite,\n' );
document.write( '                this.restartImgPos.x, this.restartImgPos.y,\n' );
document.write( '                restartSourceWidth, restartSourceHeight,\n' );
document.write( '                restartTargetX, restartTargetY, dimensions.RESTART_WIDTH,\n' );
document.write( '                dimensions.RESTART_HEIGHT);\n' );
document.write( '        }\n' );
document.write( '    };\n' );
document.write( '\n' );
document.write( '\n' );
document.write( '    //******************************************************************************\n' );
document.write( '\n' );
document.write( '    /**\n' );
document.write( '     * Check for a collision.\n' );
document.write( '     * @param {!Obstacle} obstacle\n' );
document.write( '     * @param {!Trex} tRex T-rex object.\n' );
document.write( '     * @param {HTMLCanvasContext} opt_canvasCtx Optional canvas context for drawing\n' );
document.write( '     *    collision boxes.\n' );
document.write( '     * @return {Array<CollisionBox>}\n' );
document.write( '     */\n' );
document.write( '    function checkForCollision(obstacle, tRex, opt_canvasCtx) {\n' );
document.write( '        var obstacleBoxXPos = Runner.defaultDimensions.WIDTH + obstacle.xPos;\n' );
document.write( '\n' );
document.write( '        // Adjustments are made to the bounding box as there is a 1 pixel white\n' );
document.write( '        // border around the t-rex and obstacles.\n' );
document.write( '        var tRexBox = new CollisionBox(\n' );
document.write( '            tRex.xPos + 1,\n' );
document.write( '            tRex.yPos + 1,\n' );
document.write( '            tRex.config.WIDTH - 2,\n' );
document.write( '            tRex.config.HEIGHT - 2);\n' );
document.write( '\n' );
document.write( '        var obstacleBox = new CollisionBox(\n' );
document.write( '            obstacle.xPos + 1,\n' );
document.write( '            obstacle.yPos + 1,\n' );
document.write( '            obstacle.typeConfig.width * obstacle.size - 2,\n' );
document.write( '            obstacle.typeConfig.height - 2);\n' );
document.write( '\n' );
document.write( '        // Debug outer box\n' );
document.write( '        if (opt_canvasCtx) {\n' );
document.write( '            drawCollisionBoxes(opt_canvasCtx, tRexBox, obstacleBox);\n' );
document.write( '        }\n' );
document.write( '\n' );
document.write( '        // Simple outer bounds check.\n' );
document.write( '        if (boxCompare(tRexBox, obstacleBox)) {\n' );
document.write( '            var collisionBoxes = obstacle.collisionBoxes;\n' );
document.write( '            var tRexCollisionBoxes = tRex.ducking ?\n' );
document.write( '                Trex.collisionBoxes.DUCKING : Trex.collisionBoxes.RUNNING;\n' );
document.write( '\n' );
document.write( '            // Detailed axis aligned box check.\n' );
document.write( '            for (var t = 0; t < tRexCollisionBoxes.length; t++) {\n' );
document.write( '                for (var i = 0; i < collisionBoxes.length; i++) {\n' );
document.write( '                    // Adjust the box to actual positions.\n' );
document.write( '                    var adjTrexBox =\n' );
document.write( '                        createAdjustedCollisionBox(tRexCollisionBoxes[t], tRexBox);\n' );
document.write( '                    var adjObstacleBox =\n' );
document.write( '                        createAdjustedCollisionBox(collisionBoxes[i], obstacleBox);\n' );
document.write( '                    var crashed = boxCompare(adjTrexBox, adjObstacleBox);\n' );
document.write( '\n' );
document.write( '                    // Draw boxes for debug.\n' );
document.write( '                    if (opt_canvasCtx) {\n' );
document.write( '                        drawCollisionBoxes(opt_canvasCtx, adjTrexBox, adjObstacleBox);\n' );
document.write( '                    }\n' );
document.write( '\n' );
document.write( '                    if (crashed) {\n' );
document.write( '                        return [adjTrexBox, adjObstacleBox];\n' );
document.write( '                    }\n' );
document.write( '                }\n' );
document.write( '            }\n' );
document.write( '        }\n' );
document.write( '        return false;\n' );
document.write( '    };\n' );
document.write( '\n' );
document.write( '\n' );
document.write( '    /**\n' );
document.write( '     * Adjust the collision box.\n' );
document.write( '     * @param {!CollisionBox} box The original box.\n' );
document.write( '     * @param {!CollisionBox} adjustment Adjustment box.\n' );
document.write( '     * @return {CollisionBox} The adjusted collision box object.\n' );
document.write( '     */\n' );
document.write( '    function createAdjustedCollisionBox(box, adjustment) {\n' );
document.write( '        return new CollisionBox(\n' );
document.write( '            box.x + adjustment.x,\n' );
document.write( '            box.y + adjustment.y,\n' );
document.write( '            box.width,\n' );
document.write( '            box.height);\n' );
document.write( '    };\n' );
document.write( '\n' );
document.write( '\n' );
document.write( '    /**\n' );
document.write( '     * Draw the collision boxes for debug.\n' );
document.write( '     */\n' );
document.write( '    function drawCollisionBoxes(canvasCtx, tRexBox, obstacleBox) {\n' );
document.write( '        canvasCtx.save();\n' );
document.write( '        canvasCtx.strokeStyle = \'#f00\';\n' );
document.write( '        canvasCtx.strokeRect(tRexBox.x, tRexBox.y, tRexBox.width, tRexBox.height);\n' );
document.write( '\n' );
document.write( '        canvasCtx.strokeStyle = \'#0f0\';\n' );
document.write( '        canvasCtx.strokeRect(obstacleBox.x, obstacleBox.y,\n' );
document.write( '            obstacleBox.width, obstacleBox.height);\n' );
document.write( '        canvasCtx.restore();\n' );
document.write( '    };\n' );
document.write( '\n' );
document.write( '\n' );
document.write( '    /**\n' );
document.write( '     * Compare two collision boxes for a collision.\n' );
document.write( '     * @param {CollisionBox} tRexBox\n' );
document.write( '     * @param {CollisionBox} obstacleBox\n' );
document.write( '     * @return {boolean} Whether the boxes intersected.\n' );
document.write( '     */\n' );
document.write( '    function boxCompare(tRexBox, obstacleBox) {\n' );
document.write( '        var crashed = false;\n' );
document.write( '        var tRexBoxX = tRexBox.x;\n' );
document.write( '        var tRexBoxY = tRexBox.y;\n' );
document.write( '\n' );
document.write( '        var obstacleBoxX = obstacleBox.x;\n' );
document.write( '        var obstacleBoxY = obstacleBox.y;\n' );
document.write( '\n' );
document.write( '        // Axis-Aligned Bounding Box method.\n' );
