document.write( '        draw: function (digitPos, value, opt_highScore) {\n' );
document.write( '            var sourceWidth = DistanceMeter.dimensions.WIDTH;\n' );
document.write( '            var sourceHeight = DistanceMeter.dimensions.HEIGHT;\n' );
document.write( '            var sourceX = DistanceMeter.dimensions.WIDTH * value;\n' );
