document.write( '        getActualDistance: function (distance) {\n' );
document.write( '            return distance ? Math.round(distance * this.config.COEFFICIENT) : 0;\n' );
document.write( '        },\n' );
document.write( '\n' );
document.write( '        /**\n' );
document.write( '         * Update the distance meter.\n' );
document.write( '         * @param {number} distance\n' );
document.write( '         * @param {number} deltaTime\n' );
