document.write( '         */\n' );
document.write( '        update: function (deltaTime, distance) {\n' );
document.write( '            var paint = true;\n' );
document.write( '            var playSound = false;\n' );
document.write( '\n' );
document.write( '            if (!this.acheivement) {\n' );
document.write( '                distance = this.getActualDistance(distance);\n' );
document.write( '                // Score has gone beyond the initial digit count.\n' );
document.write( '                if (distance > this.maxScore && this.maxScoreUnits ==\n' );
document.write( '                    this.config.MAX_DISTANCE_UNITS) {\n' );
document.write( '                    this.maxScoreUnits++;\n' );
document.write( '                    this.maxScore = parseInt(this.maxScore + \'9\');\n' );
document.write( '                } else {\n' );
document.write( '                    this.distance = 0;\n' );
document.write( '                }\n' );
document.write( '\n' );
document.write( '                if (distance > 0) {\n' );
