document.write( '                        distance).substr(-this.maxScoreUnits);\n' );
document.write( '                    this.digits = distanceStr.split(\'\');\n' );
document.write( '                } else {\n' );
document.write( '                    this.digits = this.defaultString.split(\'\');\n' );
document.write( '                }\n' );
document.write( '            } else {\n' );
document.write( '                // Control flashing of the score on reaching acheivement.\n' );
