document.write( '\n' );
document.write( '                    if (this.flashTimer < this.config.FLASH_DURATION) {\n' );
document.write( '                        paint = false;\n' );
document.write( '                    } else if (this.flashTimer >\n' );
document.write( '                        this.config.FLASH_DURATION * 2) {\n' );
document.write( '                        this.flashTimer = 0;\n' );
document.write( '                        this.flashIterations++;\n' );
document.write( '                    }\n' );
document.write( '                } else {\n' );
