document.write( '                    this.flashTimer = 0;\n' );
document.write( '                }\n' );
document.write( '            }\n' );
document.write( '\n' );
document.write( '            // Draw the digits if not flashing.\n' );
document.write( '            if (paint) {\n' );
document.write( '                for (var i = this.digits.length - 1; i >= 0; i--) {\n' );
