document.write( '\n' );
document.write( '            this.drawHighScore();\n' );
document.write( '            return playSound;\n' );
document.write( '        },\n' );
document.write( '\n' );
document.write( '        /**\n' );
document.write( '         * Draw the high score.\n' );
