document.write( '\n' );
document.write( '\n' );
document.write( '    //******************************************************************************\n' );
document.write( '\n' );
document.write( '    /**\n' );
document.write( '     * Cloud background item.\n' );
document.write( '     * Similar to an obstacle object but without collision boxes.\n' );
document.write( '     * @param {HTMLCanvasElement} canvas Canvas element.\n' );
document.write( '     * @param {Object} spritePos Position of image in sprite.\n' );
document.write( '     * @param {number} containerWidth\n' );
document.write( '     */\n' );
document.write( '    function Cloud(canvas, spritePos, containerWidth) {\n' );
document.write( '        this.canvas = canvas;\n' );
document.write( '        this.canvasCtx = this.canvas.getContext(\'2d\');\n' );
document.write( '        this.spritePos = spritePos;\n' );
document.write( '        this.containerWidth = containerWidth;\n' );
document.write( '        this.xPos = containerWidth;\n' );
document.write( '        this.yPos = 0;\n' );
document.write( '        this.remove = false;\n' );
document.write( '        this.cloudGap = getRandomNum(Cloud.config.MIN_CLOUD_GAP,\n' );
document.write( '            Cloud.config.MAX_CLOUD_GAP);\n' );
document.write( '\n' );
document.write( '        this.init();\n' );
document.write( '    };\n' );
document.write( '\n' );
document.write( '\n' );
document.write( '    /**\n' );
document.write( '     * Cloud object config.\n' );
document.write( '     * @enum {number}\n' );
document.write( '     */\n' );
document.write( '    Cloud.config = {\n' );
document.write( '        HEIGHT: 14,\n' );
document.write( '        MAX_CLOUD_GAP: 400,\n' );
document.write( '        MAX_SKY_LEVEL: 30,\n' );
document.write( '        MIN_CLOUD_GAP: 100,\n' );
document.write( '        MIN_SKY_LEVEL: 71,\n' );
document.write( '        WIDTH: 46\n' );
document.write( '    };\n' );
document.write( '\n' );
document.write( '\n' );
document.write( '    Cloud.prototype = {\n' );
document.write( '        /**\n' );
document.write( '         * Initialise the cloud. Sets the Cloud height.\n' );
document.write( '         */\n' );
document.write( '        init: function () {\n' );
document.write( '            this.yPos = getRandomNum(Cloud.config.MAX_SKY_LEVEL,\n' );
document.write( '                Cloud.config.MIN_SKY_LEVEL);\n' );
document.write( '            this.draw();\n' );
document.write( '        },\n' );
document.write( '\n' );
document.write( '        /**\n' );
document.write( '         * Draw the cloud.\n' );
document.write( '         */\n' );
document.write( '        draw: function () {\n' );
document.write( '            this.canvasCtx.save();\n' );
document.write( '            var sourceWidth = Cloud.config.WIDTH;\n' );
document.write( '            var sourceHeight = Cloud.config.HEIGHT;\n' );
document.write( '\n' );
document.write( '            if (IS_HIDPI) {\n' );
document.write( '                sourceWidth = sourceWidth * 2;\n' );
document.write( '                sourceHeight = sourceHeight * 2;\n' );
document.write( '            }\n' );
document.write( '\n' );
document.write( '            this.canvasCtx.drawImage(Runner.imageSprite, this.spritePos.x,\n' );
document.write( '                this.spritePos.y,\n' );
document.write( '                sourceWidth, sourceHeight,\n' );
document.write( '                this.xPos, this.yPos,\n' );
document.write( '                Cloud.config.WIDTH, Cloud.config.HEIGHT);\n' );
document.write( '\n' );
document.write( '            this.canvasCtx.restore();\n' );
document.write( '        },\n' );
document.write( '\n' );
document.write( '        /**\n' );
document.write( '         * Update the cloud position.\n' );
document.write( '         * @param {number} speed\n' );
document.write( '         */\n' );
document.write( '        update: function (speed) {\n' );
document.write( '            if (!this.remove) {\n' );
document.write( '                this.xPos -= Math.ceil(speed);\n' );
document.write( '                this.draw();\n' );
document.write( '\n' );
document.write( '                // Mark as removeable if no longer in the canvas.\n' );
document.write( '                if (!this.isVisible()) {\n' );
document.write( '                    this.remove = true;\n' );
document.write( '                }\n' );
document.write( '            }\n' );
document.write( '        },\n' );
document.write( '\n' );
document.write( '        /**\n' );
document.write( '         * Check if the cloud is visible on the stage.\n' );
document.write( '         * @return {boolean}\n' );
document.write( '         */\n' );
document.write( '        isVisible: function () {\n' );
document.write( '            return this.xPos + Cloud.config.WIDTH > 0;\n' );
document.write( '        }\n' );
document.write( '    };\n' );
document.write( '\n' );
document.write( '\n' );
document.write( '    //******************************************************************************\n' );
document.write( '\n' );
document.write( '    /**\n' );
document.write( '     * Nightmode shows a moon and stars on the horizon.\n' );
document.write( '     */\n' );
document.write( '    function NightMode(canvas, spritePos, containerWidth) {\n' );
document.write( '        this.spritePos = spritePos;\n' );
document.write( '        this.canvas = canvas;\n' );
document.write( '        this.canvasCtx = canvas.getContext(\'2d\');\n' );
document.write( '        this.xPos = containerWidth - 50;\n' );
document.write( '        this.yPos = 30;\n' );
document.write( '        this.currentPhase = 0;\n' );
document.write( '        this.opacity = 0;\n' );
document.write( '        this.containerWidth = containerWidth;\n' );
document.write( '        this.stars = [];\n' );
document.write( '        this.drawStars = false;\n' );
document.write( '        this.placeStars();\n' );
document.write( '    };\n' );
document.write( '\n' );
document.write( '    /**\n' );
document.write( '     * @enum {number}\n' );
document.write( '     */\n' );
document.write( '    NightMode.config = {\n' );
document.write( '        FADE_SPEED: 0.035,\n' );
document.write( '        HEIGHT: 40,\n' );
document.write( '        MOON_SPEED: 0.25,\n' );
document.write( '        NUM_STARS: 2,\n' );
document.write( '        STAR_SIZE: 9,\n' );
document.write( '        STAR_SPEED: 0.3,\n' );
document.write( '        STAR_MAX_Y: 70,\n' );
document.write( '        WIDTH: 20\n' );
document.write( '    };\n' );
document.write( '\n' );
document.write( '    NightMode.phases = [140, 120, 100, 60, 40, 20, 0];\n' );
document.write( '\n' );
document.write( '    NightMode.prototype = {\n' );
document.write( '        /**\n' );
document.write( '         * Update moving moon, changing phases.\n' );
document.write( '         * @param {boolean} activated Whether night mode is activated.\n' );
document.write( '         * @param {number} delta\n' );
document.write( '         */\n' );
document.write( '        update: function (activated, delta) {\n' );
document.write( '            // Moon phase.\n' );
document.write( '            if (activated && this.opacity == 0) {\n' );
document.write( '                this.currentPhase++;\n' );
document.write( '\n' );
document.write( '                if (this.currentPhase >= NightMode.phases.length) {\n' );
document.write( '                    this.currentPhase = 0;\n' );
document.write( '                }\n' );
document.write( '            }\n' );
document.write( '\n' );
document.write( '            // Fade in / out.\n' );
document.write( '            if (activated && (this.opacity < 1 || this.opacity == 0)) {\n' );
document.write( '                this.opacity += NightMode.config.FADE_SPEED;\n' );
document.write( '            } else if (this.opacity > 0) {\n' );
document.write( '                this.opacity -= NightMode.config.FADE_SPEED;\n' );
document.write( '            }\n' );
document.write( '\n' );
document.write( '            // Set moon positioning.\n' );
document.write( '            if (this.opacity > 0) {\n' );
document.write( '                this.xPos = this.updateXPos(this.xPos, NightMode.config.MOON_SPEED);\n' );
document.write( '\n' );
document.write( '                // Update stars.\n' );
document.write( '                if (this.drawStars) {\n' );
document.write( '                    for (var i = 0; i < NightMode.config.NUM_STARS; i++) {\n' );
document.write( '                        this.stars[i].x = this.updateXPos(this.stars[i].x,\n' );
document.write( '                            NightMode.config.STAR_SPEED);\n' );
document.write( '                    }\n' );
document.write( '                }\n' );
document.write( '                this.draw();\n' );
document.write( '            } else {\n' );
document.write( '                this.opacity = 0;\n' );
document.write( '                this.placeStars();\n' );
document.write( '            }\n' );
document.write( '            this.drawStars = true;\n' );
document.write( '        },\n' );
document.write( '\n' );
document.write( '        updateXPos: function (currentPos, speed) {\n' );
document.write( '            if (currentPos < -NightMode.config.WIDTH) {\n' );
document.write( '                currentPos = this.containerWidth;\n' );
document.write( '            } else {\n' );
document.write( '                currentPos -= speed;\n' );
document.write( '            }\n' );
document.write( '            return currentPos;\n' );
document.write( '        },\n' );
document.write( '\n' );
document.write( '        draw: function () {\n' );
document.write( '            var moonSourceWidth = this.currentPhase == 3 ? NightMode.config.WIDTH * 2 :\n' );
document.write( '                NightMode.config.WIDTH;\n' );
document.write( '            var moonSourceHeight = NightMode.config.HEIGHT;\n' );
document.write( '            var moonSourceX = this.spritePos.x + NightMode.phases[this.currentPhase];\n' );
document.write( '            var moonOutputWidth = moonSourceWidth;\n' );
document.write( '            var starSize = NightMode.config.STAR_SIZE;\n' );
document.write( '            var starSourceX = Runner.spriteDefinition.LDPI.STAR.x;\n' );
document.write( '\n' );
document.write( '            if (IS_HIDPI) {\n' );
document.write( '                moonSourceWidth *= 2;\n' );
document.write( '                moonSourceHeight *= 2;\n' );
document.write( '                moonSourceX = this.spritePos.x +\n' );
document.write( '                    (NightMode.phases[this.currentPhase] * 2);\n' );
document.write( '                starSize *= 2;\n' );
document.write( '                starSourceX = Runner.spriteDefinition.HDPI.STAR.x;\n' );
document.write( '            }\n' );
document.write( '\n' );
document.write( '            this.canvasCtx.save();\n' );
document.write( '            this.canvasCtx.globalAlpha = this.opacity;\n' );
document.write( '\n' );
document.write( '            // Stars.\n' );
document.write( '            if (this.drawStars) {\n' );
document.write( '                for (var i = 0; i < NightMode.config.NUM_STARS; i++) {\n' );
document.write( '                    this.canvasCtx.drawImage(Runner.imageSprite,\n' );
document.write( '                        starSourceX, this.stars[i].sourceY, starSize, starSize,\n' );
document.write( '                        Math.round(this.stars[i].x), this.stars[i].y,\n' );
document.write( '                        NightMode.config.STAR_SIZE, NightMode.config.STAR_SIZE);\n' );
document.write( '                }\n' );
document.write( '            }\n' );
document.write( '\n' );
document.write( '            // Moon.\n' );
document.write( '            this.canvasCtx.drawImage(Runner.imageSprite, moonSourceX,\n' );
document.write( '                this.spritePos.y, moonSourceWidth, moonSourceHeight,\n' );
document.write( '                Math.round(this.xPos), this.yPos,\n' );
document.write( '                moonOutputWidth, NightMode.config.HEIGHT);\n' );
document.write( '\n' );
document.write( '            this.canvasCtx.globalAlpha = 1;\n' );
document.write( '            this.canvasCtx.restore();\n' );
document.write( '        },\n' );
document.write( '\n' );
document.write( '        // Do star placement.\n' );
document.write( '        placeStars: function () {\n' );
document.write( '            var segmentSize = Math.round(this.containerWidth /\n' );
document.write( '                NightMode.config.NUM_STARS);\n' );
document.write( '\n' );
document.write( '            for (var i = 0; i < NightMode.config.NUM_STARS; i++) {\n' );
document.write( '                this.stars[i] = {};\n' );
document.write( '                this.stars[i].x = getRandomNum(segmentSize * i, segmentSize * (i + 1));\n' );
document.write( '                this.stars[i].y = getRandomNum(0, NightMode.config.STAR_MAX_Y);\n' );
document.write( '\n' );
document.write( '                if (IS_HIDPI) {\n' );
document.write( '                    this.stars[i].sourceY = Runner.spriteDefinition.HDPI.STAR.y +\n' );
document.write( '                        NightMode.config.STAR_SIZE * 2 * i;\n' );
document.write( '                } else {\n' );
document.write( '                    this.stars[i].sourceY = Runner.spriteDefinition.LDPI.STAR.y +\n' );
document.write( '                        NightMode.config.STAR_SIZE * i;\n' );
document.write( '                }\n' );
document.write( '            }\n' );
document.write( '        },\n' );
document.write( '\n' );
document.write( '        reset: function () {\n' );
document.write( '            this.currentPhase = 0;\n' );
document.write( '            this.opacity = 0;\n' );
document.write( '            this.update(false);\n' );
document.write( '        }\n' );
document.write( '\n' );
document.write( '    };\n' );
document.write( '\n' );
document.write( '\n' );
document.write( '    //******************************************************************************\n' );
document.write( '\n' );
document.write( '    /**\n' );
document.write( '     * Horizon Line.\n' );
document.write( '     * Consists of two connecting lines. Randomly assigns a flat / bumpy horizon.\n' );
document.write( '     * @param {HTMLCanvasElement} canvas\n' );
document.write( '     * @param {Object} spritePos Horizon position in sprite.\n' );
document.write( '     * @constructor\n' );
document.write( '     */\n' );
document.write( '    function HorizonLine(canvas, spritePos) {\n' );
document.write( '        this.spritePos = spritePos;\n' );
document.write( '        this.canvas = canvas;\n' );
document.write( '        this.canvasCtx = canvas.getContext(\'2d\');\n' );
document.write( '        this.sourceDimensions = {};\n' );
document.write( '        this.dimensions = HorizonLine.dimensions;\n' );
document.write( '        this.sourceXPos = [this.spritePos.x, this.spritePos.x +\n' );
document.write( '            this.dimensions.WIDTH];\n' );
document.write( '        this.xPos = [];\n' );
document.write( '        this.yPos = 0;\n' );
document.write( '        this.bumpThreshold = 0.5;\n' );
document.write( '\n' );
document.write( '        this.setSourceDimensions();\n' );
document.write( '        this.draw();\n' );
document.write( '    };\n' );
document.write( '\n' );
document.write( '\n' );
document.write( '    /**\n' );
document.write( '     * Horizon line dimensions.\n' );
document.write( '     * @enum {number}\n' );
document.write( '     */\n' );
document.write( '    HorizonLine.dimensions = {\n' );
document.write( '        WIDTH: 600,\n' );
document.write( '        HEIGHT: 12,\n' );
document.write( '        YPOS: 127\n' );
document.write( '    };\n' );
document.write( '\n' );
document.write( '\n' );
document.write( '    HorizonLine.prototype = {\n' );
document.write( '        /**\n' );
document.write( '         * Set the source dimensions of the horizon line.\n' );
document.write( '         */\n' );
document.write( '        setSourceDimensions: function () {\n' );
document.write( '\n' );
document.write( '            for (var dimension in HorizonLine.dimensions) {\n' );
document.write( '                if (IS_HIDPI) {\n' );
document.write( '                    if (dimension != \'YPOS\') {\n' );
document.write( '                        this.sourceDimensions[dimension] =\n' );
document.write( '                            HorizonLine.dimensions[dimension] * 2;\n' );
document.write( '                    }\n' );
document.write( '                } else {\n' );
document.write( '                    this.sourceDimensions[dimension] =\n' );
document.write( '                        HorizonLine.dimensions[dimension];\n' );
document.write( '                }\n' );
document.write( '                this.dimensions[dimension] = HorizonLine.dimensions[dimension];\n' );
document.write( '            }\n' );
document.write( '\n' );
document.write( '            this.xPos = [0, HorizonLine.dimensions.WIDTH];\n' );
document.write( '            this.yPos = HorizonLine.dimensions.YPOS;\n' );
document.write( '        },\n' );
document.write( '\n' );
document.write( '        /**\n' );
document.write( '         * Return the crop x position of a type.\n' );
document.write( '         */\n' );
document.write( '        getRandomType: function () {\n' );
document.write( '            return Math.random() > this.bumpThreshold ? this.dimensions.WIDTH : 0;\n' );
document.write( '        },\n' );
document.write( '\n' );
document.write( '        /**\n' );
document.write( '         * Draw the horizon line.\n' );
document.write( '         */\n' );
document.write( '        draw: function () {\n' );
document.write( '            this.canvasCtx.drawImage(Runner.imageSprite, this.sourceXPos[0],\n' );
document.write( '                this.spritePos.y,\n' );
document.write( '                this.sourceDimensions.WIDTH, this.sourceDimensions.HEIGHT,\n' );
document.write( '                this.xPos[0], this.yPos,\n' );
document.write( '                this.dimensions.WIDTH, this.dimensions.HEIGHT);\n' );
document.write( '\n' );
document.write( '            this.canvasCtx.drawImage(Runner.imageSprite, this.sourceXPos[1],\n' );
document.write( '                this.spritePos.y,\n' );
document.write( '                this.sourceDimensions.WIDTH, this.sourceDimensions.HEIGHT,\n' );
document.write( '                this.xPos[1], this.yPos,\n' );
document.write( '                this.dimensions.WIDTH, this.dimensions.HEIGHT);\n' );
document.write( '        },\n' );
document.write( '\n' );
document.write( '        /**\n' );
document.write( '         * Update the x position of an indivdual piece of the line.\n' );
document.write( '         * @param {number} pos Line position.\n' );
document.write( '         * @param {number} increment\n' );
document.write( '         */\n' );
document.write( '        updateXPos: function (pos, increment) {\n' );
document.write( '            var line1 = pos;\n' );
document.write( '            var line2 = pos == 0 ? 1 : 0;\n' );
document.write( '\n' );
document.write( '            this.xPos[line1] -= increment;\n' );
document.write( '            this.xPos[line2] = this.xPos[line1] + this.dimensions.WIDTH;\n' );
document.write( '\n' );
document.write( '            if (this.xPos[line1] <= -this.dimensions.WIDTH) {\n' );
document.write( '                this.xPos[line1] += this.dimensions.WIDTH * 2;\n' );
document.write( '                this.xPos[line2] = this.xPos[line1] - this.dimensions.WIDTH;\n' );
document.write( '                this.sourceXPos[line1] = this.getRandomType() + this.spritePos.x;\n' );
document.write( '            }\n' );
document.write( '        },\n' );
document.write( '\n' );
document.write( '        /**\n' );
document.write( '         * Update the horizon line.\n' );
document.write( '         * @param {number} deltaTime\n' );
document.write( '         * @param {number} speed\n' );
document.write( '         */\n' );
document.write( '        update: function (deltaTime, speed) {\n' );
document.write( '            var increment = Math.floor(speed * (FPS / 1000) * deltaTime);\n' );
document.write( '\n' );
document.write( '            if (this.xPos[0] <= 0) {\n' );
document.write( '                this.updateXPos(0, increment);\n' );
document.write( '            } else {\n' );
document.write( '                this.updateXPos(1, increment);\n' );
document.write( '            }\n' );
document.write( '            this.draw();\n' );
document.write( '        },\n' );
document.write( '\n' );
document.write( '        /**\n' );
document.write( '         * Reset horizon to the starting position.\n' );
document.write( '         */\n' );
document.write( '        reset: function () {\n' );
document.write( '            this.xPos[0] = 0;\n' );
document.write( '            this.xPos[1] = HorizonLine.dimensions.WIDTH;\n' );
document.write( '        }\n' );
document.write( '    };\n' );
document.write( '\n' );
document.write( '\n' );
document.write( '    //******************************************************************************\n' );
document.write( '\n' );
document.write( '    /**\n' );
document.write( '     * Horizon background class.\n' );
document.write( '     * @param {HTMLCanvasElement} canvas\n' );
document.write( '     * @param {Object} spritePos Sprite positioning.\n' );
document.write( '     * @param {Object} dimensions Canvas dimensions.\n' );
document.write( '     * @param {number} gapCoefficient\n' );
document.write( '     * @constructor\n' );
document.write( '     */\n' );
document.write( '    function Horizon(canvas, spritePos, dimensions, gapCoefficient) {\n' );
document.write( '        this.canvas = canvas;\n' );
document.write( '        this.canvasCtx = this.canvas.getContext(\'2d\');\n' );
document.write( '        this.config = Horizon.config;\n' );
document.write( '        this.dimensions = dimensions;\n' );
document.write( '        this.gapCoefficient = gapCoefficient;\n' );
document.write( '        this.obstacles = [];\n' );
document.write( '        this.obstacleHistory = [];\n' );
document.write( '        this.horizonOffsets = [0, 0];\n' );
document.write( '        this.cloudFrequency = this.config.CLOUD_FREQUENCY;\n' );
document.write( '        this.spritePos = spritePos;\n' );
document.write( '        this.nightMode = null;\n' );
document.write( '\n' );
document.write( '        // Cloud\n' );
document.write( '        this.clouds = [];\n' );
document.write( '        this.cloudSpeed = this.config.BG_CLOUD_SPEED;\n' );
document.write( '\n' );
document.write( '        // Horizon\n' );
document.write( '        this.horizonLine = null;\n' );
document.write( '        this.init();\n' );
document.write( '    };\n' );
document.write( '\n' );
document.write( '\n' );
document.write( '    /**\n' );
document.write( '     * Horizon config.\n' );
document.write( '     * @enum {number}\n' );
document.write( '     */\n' );
document.write( '    Horizon.config = {\n' );
document.write( '        BG_CLOUD_SPEED: 0.2,\n' );
document.write( '        BUMPY_THRESHOLD: .3,\n' );
document.write( '        CLOUD_FREQUENCY: .5,\n' );
document.write( '        HORIZON_HEIGHT: 16,\n' );
document.write( '        MAX_CLOUDS: 6\n' );
document.write( '    };\n' );
document.write( '\n' );
document.write( '\n' );
document.write( '    Horizon.prototype = {\n' );
document.write( '        /**\n' );
document.write( '         * Initialise the horizon. Just add the line and a cloud. No obstacles.\n' );
document.write( '         */\n' );
document.write( '        init: function () {\n' );
document.write( '            this.addCloud();\n' );
document.write( '            this.horizonLine = new HorizonLine(this.canvas, this.spritePos.HORIZON);\n' );
document.write( '            this.nightMode = new NightMode(this.canvas, this.spritePos.MOON,\n' );
document.write( '                this.dimensions.WIDTH);\n' );
document.write( '        },\n' );
document.write( '\n' );
document.write( '        /**\n' );
document.write( '         * @param {number} deltaTime\n' );
document.write( '         * @param {number} currentSpeed\n' );
document.write( '         * @param {boolean} updateObstacles Used as an override to prevent\n' );
document.write( '         *     the obstacles from being updated / added. This happens in the\n' );
document.write( '         *     ease in section.\n' );
document.write( '         * @param {boolean} showNightMode Night mode activated.\n' );
document.write( '         */\n' );
document.write( '        update: function (deltaTime, currentSpeed, updateObstacles, showNightMode) {\n' );
document.write( '            this.runningTime += deltaTime;\n' );
document.write( '            this.horizonLine.update(deltaTime, currentSpeed);\n' );
document.write( '            this.nightMode.update(showNightMode);\n' );
document.write( '            this.updateClouds(deltaTime, currentSpeed);\n' );
document.write( '\n' );
document.write( '            if (updateObstacles) {\n' );
document.write( '                this.updateObstacles(deltaTime, currentSpeed);\n' );
document.write( '            }\n' );
document.write( '        },\n' );
document.write( '\n' );
document.write( '        /**\n' );
document.write( '         * Update the cloud positions.\n' );
document.write( '         * @param {number} deltaTime\n' );
document.write( '         * @param {number} currentSpeed\n' );
document.write( '         */\n' );
document.write( '        updateClouds: function (deltaTime, speed) {\n' );
document.write( '            var cloudSpeed = this.cloudSpeed / 1000 * deltaTime * speed;\n' );
document.write( '            var numClouds = this.clouds.length;\n' );
document.write( '\n' );
document.write( '            if (numClouds) {\n' );
document.write( '                for (var i = numClouds - 1; i >= 0; i--) {\n' );
document.write( '                    this.clouds[i].update(cloudSpeed);\n' );
document.write( '                }\n' );
document.write( '\n' );
document.write( '                var lastCloud = this.clouds[numClouds - 1];\n' );
document.write( '\n' );
document.write( '                // Check for adding a new cloud.\n' );
document.write( '                if (numClouds < this.config.MAX_CLOUDS &&\n' );
document.write( '                    (this.dimensions.WIDTH - lastCloud.xPos) > lastCloud.cloudGap &&\n' );
document.write( '                    this.cloudFrequency > Math.random()) {\n' );
document.write( '                    this.addCloud();\n' );
document.write( '                }\n' );
document.write( '\n' );
document.write( '                // Remove expired clouds.\n' );
document.write( '                this.clouds = this.clouds.filter(function (obj) {\n' );
document.write( '                    return !obj.remove;\n' );
document.write( '                });\n' );
document.write( '            } else {\n' );
document.write( '                this.addCloud();\n' );
document.write( '            }\n' );
document.write( '        },\n' );
document.write( '\n' );
document.write( '        /**\n' );
document.write( '         * Update the obstacle positions.\n' );
document.write( '         * @param {number} deltaTime\n' );
document.write( '         * @param {number} currentSpeed\n' );
document.write( '         */\n' );
document.write( '        updateObstacles: function (deltaTime, currentSpeed) {\n' );
document.write( '            // Obstacles, move to Horizon layer.\n' );
document.write( '            var updatedObstacles = this.obstacles.slice(0);\n' );
document.write( '\n' );
document.write( '            for (var i = 0; i < this.obstacles.length; i++) {\n' );
document.write( '                var obstacle = this.obstacles[i];\n' );
document.write( '                obstacle.update(deltaTime, currentSpeed);\n' );
document.write( '\n' );
document.write( '                // Clean up existing obstacles.\n' );
document.write( '                if (obstacle.remove) {\n' );
document.write( '                    updatedObstacles.shift();\n' );
document.write( '                }\n' );
document.write( '            }\n' );
document.write( '            this.obstacles = updatedObstacles;\n' );
document.write( '\n' );
document.write( '            if (this.obstacles.length > 0) {\n' );
document.write( '                var lastObstacle = this.obstacles[this.obstacles.length - 1];\n' );
document.write( '\n' );
document.write( '                if (lastObstacle && !lastObstacle.followingObstacleCreated &&\n' );
document.write( '                    lastObstacle.isVisible() &&\n' );
document.write( '                    (lastObstacle.xPos + lastObstacle.width + lastObstacle.gap) <\n' );
document.write( '                    this.dimensions.WIDTH) {\n' );
document.write( '                    this.addNewObstacle(currentSpeed);\n' );
document.write( '                    lastObstacle.followingObstacleCreated = true;\n' );
document.write( '                }\n' );
document.write( '            } else {\n' );
document.write( '                // Create new obstacles.\n' );
document.write( '                this.addNewObstacle(currentSpeed);\n' );
document.write( '            }\n' );
document.write( '        },\n' );
document.write( '\n' );
document.write( '        removeFirstObstacle: function () {\n' );
document.write( '            this.obstacles.shift();\n' );
document.write( '        },\n' );
document.write( '\n' );
document.write( '        /**\n' );
document.write( '         * Add a new obstacle.\n' );
document.write( '         * @param {number} currentSpeed\n' );
document.write( '         */\n' );
document.write( '        addNewObstacle: function (currentSpeed) {\n' );
document.write( '            var obstacleTypeIndex = getRandomNum(0, Obstacle.types.length - 1);\n' );
document.write( '            var obstacleType = Obstacle.types[obstacleTypeIndex];\n' );
document.write( '\n' );
document.write( '            // Check for multiples of the same type of obstacle.\n' );
document.write( '            // Also check obstacle is available at current speed.\n' );
document.write( '            if (this.duplicateObstacleCheck(obstacleType.type) ||\n' );
document.write( '                currentSpeed < obstacleType.minSpeed) {\n' );
document.write( '                this.addNewObstacle(currentSpeed);\n' );
document.write( '            } else {\n' );
document.write( '                var obstacleSpritePos = this.spritePos[obstacleType.type];\n' );
document.write( '\n' );
document.write( '                this.obstacles.push(new Obstacle(this.canvasCtx, obstacleType,\n' );
document.write( '                    obstacleSpritePos, this.dimensions,\n' );
document.write( '                    this.gapCoefficient, currentSpeed, obstacleType.width));\n' );
document.write( '\n' );
document.write( '                this.obstacleHistory.unshift(obstacleType.type);\n' );
document.write( '\n' );
document.write( '                if (this.obstacleHistory.length > 1) {\n' );
document.write( '                    this.obstacleHistory.splice(Runner.config.MAX_OBSTACLE_DUPLICATION);\n' );
document.write( '                }\n' );
document.write( '            }\n' );
document.write( '        },\n' );
document.write( '\n' );
document.write( '        /**\n' );
document.write( '         * Returns whether the previous two obstacles are the same as the next one.\n' );
document.write( '         * Maximum duplication is set in config value MAX_OBSTACLE_DUPLICATION.\n' );
document.write( '         * @return {boolean}\n' );
document.write( '         */\n' );
document.write( '        duplicateObstacleCheck: function (nextObstacleType) {\n' );
document.write( '            var duplicateCount = 0;\n' );
document.write( '\n' );
document.write( '            for (var i = 0; i < this.obstacleHistory.length; i++) {\n' );
document.write( '                duplicateCount = this.obstacleHistory[i] == nextObstacleType ?\n' );
document.write( '                    duplicateCount + 1 : 0;\n' );
document.write( '            }\n' );
document.write( '            return duplicateCount >= Runner.config.MAX_OBSTACLE_DUPLICATION;\n' );
document.write( '        },\n' );
document.write( '\n' );
document.write( '        /**\n' );
document.write( '         * Reset the horizon layer.\n' );
document.write( '         * Remove existing obstacles and reposition the horizon line.\n' );
document.write( '         */\n' );
document.write( '        reset: function () {\n' );
document.write( '            this.obstacles = [];\n' );
document.write( '            this.horizonLine.reset();\n' );
document.write( '            this.nightMode.reset();\n' );
document.write( '        },\n' );
document.write( '\n' );
document.write( '        /**\n' );
document.write( '         * Update the canvas width and scaling.\n' );
document.write( '         * @param {number} width Canvas width.\n' );
document.write( '         * @param {number} height Canvas height.\n' );
document.write( '         */\n' );
document.write( '        resize: function (width, height) {\n' );
document.write( '            this.canvas.width = width;\n' );
document.write( '            this.canvas.height = height;\n' );
document.write( '        },\n' );
document.write( '\n' );
document.write( '        /**\n' );
document.write( '         * Add a new cloud to the horizon.\n' );
document.write( '         */\n' );
document.write( '        addCloud: function () {\n' );
document.write( '            this.clouds.push(new Cloud(this.canvas, this.spritePos.CLOUD,\n' );
document.write( '                this.dimensions.WIDTH));\n' );
document.write( '        }\n' );
document.write( '    };\n' );
document.write( '})();\n' );
document.write( '\n' );
document.write( '\n' );
document.write( 'function onDocumentLoad() {\n' );
document.write( '    new Runner(\'.interstitial-wrapper\');\n' );
document.write( '}\n' );
document.write( '\n' );
document.write( 'document.addEventListener(\'DOMContentLoaded\', onDocumentLoad);\n' );
document.write( '</script>\n' );
document.write( '</head>\n' );
